The `<tfoot>` HTML element a set of rows summarizing the columns of the table.
It is a direct child of the `<table>` element.

#### Example:

```purescript
table {}
  [ thead {} [ tr {} [ th {} "Item", th {} "Price" ] ]
  , tbody {}
      [ tr {} [ td {} "Apples", td {} "£10" ]
      , tr {} [ td {} "Oranges", td {} "£12" ]
      ]
  , tfoot {} [ tr {} [ th {} "Total", td {} "£22" ]
  ]
```

The `<table>` HTML element represents data in two dimensions or more.

#### Example:

```purescript
table {}
  [ thead {}
    [ tr {} [ th {} "Header No. 1", th {} "Header No. 2" ]
  , tbody {}
    [ tr {} [ td {} "Row 1, Col 1", td {} "Row 1, Col 2" ]
    , tr {} [ td {} "Row 2, Col 1", td {} "Row 2, Col 2" ]
    ]
  ]
```

| Header No. 1 | Header No. 2 |
| --- | --- |
| Row 1, Col 1 | Row 1, Col 2 |
| Row 2, Col 1 | Row 2, Col 2 |

The `<source>` HTML element is used to specify multiple media resources for media elements, such as `<picture>`, `<audio>`, and `<video>`.

#### Example:

```purescript
picture {}
  [ source { srcset: "image-large.jpg", media: "(min-width: 800px)", type: "image/jpeg" }
  , source { srcset: "image-medium.jpg", media: "(min-width: 600px)", type: "image/jpeg" }
  , img { src: "image-small.jpg", alt: "Description" }
  ]
```

#### Common attributes:

| Name            | Type   | Example     | Description                             |
|-----------------|--------|-------------|-----------------------------------------|
| `src`           | String | "audio.ogg" | URL of the media file or stream         |
| `type`          | String | "audio/ogg" | Type of the media file or stream       |
| `media`         | String | "(min-width: 600px)" | Media query of the media resource |
| `srcset`        | String | "image-1x.jpg 1x, image-2x.jpg 2x" | Image source set for `<picture>` |

The `<picture>` HTML element contains zero or more `<source>` elements and one `<img>` element to offer alternative versions of an image for different display scenarios.

#### Example:

```purescript
picture {}
  [ source { srcset: "large.jpg", media: "(min-width: 800px)" }
  , source { srcset: "medium.jpg", media: "(min-width: 600px)" }
  , img { src: "small.jpg", alt: "Description of the image" }
  ]-- | ```

The `<nav>` HTML element represents a section of a page whose purpose is to provide navigation links.

#### Example:

```purescript
nav { className: "mainNav" }
  [ ul {}
      [ li {} $ a { href: "#section1" } "Section 1"
      , li {} $ a { href: "#section2" } "Section 2"
      ]
  ]
```

The `<meta>` tag in HTML, which provides metadata about the HTML document. Metadata is not displayed but is machine parsable.
**meta is a void element** — it can't contain any children
#### Example:
```purescript
-- General meta tags
meta { charSet: "utf-8" }
meta { name: "viewport", content: "width=device-width, initial-scale=1" }
meta { name: "description", content: "This is the description of the page." }
meta { name: "keywords", content: "keyword1, keyword2, keyword3" }

-- Open Graph tags (for Facebook, LinkedIn etc.)
meta { property: "og:title", content: "The Title of the Webpage" }
meta { property: "og:description", content: "The description of the webpage." }
meta { property: "og:image", content: "https://example.com/path/to/image.jpg" }
meta { property: "og:url", content: "https://example.com/page.html" }

-- Twitter card tags
meta { name: "twitter:card", content: "summary_large_image" }
meta { name: "twitter:creator", content: "@username" }
meta { name: "twitter:title", content: "The Title of the Webpage" }
meta { name: "twitter:description", content: "The description of the webpage." }
meta { name: "twitter:image", content: "https://example.com/path/to/image.jpg" }
```

Common attributes:

| Attribute  | Type     | Example                                 | Description |
|------------|----------|-----------------------------------------|-------------|
| `charSet`  | `String` | `"UTF-8"`                               | Specifies the character encoding for the HTML document. |
| `content`  | `String` | `"width=device-width, initial-scale=1"` | Gives the value associated with the `http-equiv` or `name` attribute. |
| `http-equiv` | `String` | `"refresh"`                             | Provides an HTTP header for the information/value of the content attribute. |
| `name`     | `String` | `"description"`                         | Defines a name for the metadata. |
| `property` | `String` | `"og:title"`                            | Defines the property the metadata should be associated with. |meta :: FFIComponent_ MetaAttributes

